var title_f29_54_30563="EP study tracings RBB ablation for BBRVT";
var content_f29_54_30563=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 539px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG tracings during radiofrequency catheter ablation of the right bundle branch in a patient with BBRVT",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 519px; height: 364px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are five surface ECG leads (I, II, aVF, V1, V6) and intracardiac recordings from the His bundle region (HBE2-3,1-2), the right ventricular apex (RVA3-4), and a mapping catheter (USER1) positioned distal to the His catheter along the RV septum. Application of radiofrequency (RF) energy to the tip of the mapping catheter causes two accelerated beats with a typical left bundle branch block (LBBB) morphology (black arrow), likely from heating and activating the right bundle branch. After these beats, complete right bundle branch block (RBBB) is present (red arrow), as evidenced by the change in QRS morphology, particularly in lead V1. Following right bundle branch ablation, the HV interval increased to 105 ms, though no infranodal A-V block was noted. Right bundle branch reentrant tachycardia was no longer inducible. A permanent pacemaker was placed becaued of the markedly prolonged HV interval.",
"    <div class=\"footnotes\">",
"     H: His bundle electrogram; A: atrial electrogram; V: ventricular electrogram.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
