" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Change in lipid levels with age",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 397px; height: 250px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
